effect:
1 Monstro Regulador do Tipo "Universo G" + 1 Monstro do Tipo "Universo G" ou;
2 Monstros do Tipo "Universo G"
Esta carta não pode atacar no turno que é invocada. Quando o monstro de qualquer duelista declarar um ataque, desacople uma Matéria Xyz desta carta e negue o ataque. Se este monstro foi invocado com um Monstro Regulador, invoque o Monstro Regulador Material Xyz com uma Invocação Especial ou Invocação Pêndulo.
